import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Test1 from './Test1';// import component Test1 vào để sử dụng
import App from './App';// là App.js
import * as serviceWorker from './serviceWorker';

// câu lệnh lấy compoenent App bỏ vào trong cái div có id = root 
// với <App/> có trong ./App
ReactDOM.render(<App />, document.getElementById('root'));//lấy cái element có id = root để đổ html ở App.js vào (ở index.html)
ReactDOM.render(<Test1 />, document.getElementById('dauxanh'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
